      <style>
      html, body {
        width: 100%;
        height: 100%;
      }
  
      body {
        padding: 0;
        margin: 0;
        color: white;
        font-family: "Inter", sans-serif;
        font-size: calc(10px + (21 - 10) * ((100vw - 1000px)/(2600 - 1000)));
      }
  
      .container-wrap {
        width: 100%;
        height: 100%;
        display: flex;
        flex-direction: column;
        justify-content: flex-start;
        align-items: flex-start;
        text-align: left;
      }
  
      .title-wrap {
        padding: 5px 0; 
        margin: 8px 0; 
        font-size: 1.25em; 
        text-shadow: 0 2px 1px rgba(0,0,0,.6); 
        line-height: 120%;
      }
  
      .title {
        display: flex;
        flex-direction: row;
        justify-content: center;
        align-items: center;
        color: #eee;
        font-weight: 400;
        letter-spacing: .5px;
      }
  
      .container {
        width: 100%;
        height: 100%;
        display: flex;
        flex-direction: row;
        overflow: hidden;
        justify-content: space-around;
        gap: 10px;
      }
  
      a {
        text-decoration: none;
      }
  
      .img-item {
        display: inline-block;
        position: relative;
        aspect-ratio: 9 / 16;
        overflow: hidden;
        border-radius: 8px;
      }
  
      .img-item img {
        height: 100%;
        width: 100%;
        object-fit: cover;
        transition: transform 0.3s ease-in-out;
      }
  
      .img-item:hover img {
        transform: scale(1.05);
      }
  
      .img-text {
        position: absolute;
        top: 0;
        bottom: 0;
        left: 0;
        right: 0;
        width: 100%;
        height: 100%;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        align-items: start;
        z-index: 10;
        font-size: 14px; 
      }
  
      span {
        margin: 10px 6px;
        color: white;
        font-weight: 600;
        width: 90%;
        overflow: hidden;
        white-space: nowrap;
        text-overflow: ellipsis;
        text-shadow: 0px 1px 6px rgba(0, 0, 0, 0.6);
      }
  
      .live {
        color: white;
        margin: 6px;
        font-weight: 500;
        text-transform: uppercase;
        padding: 0 5px;
        border-radius: 9999px;
        background: linear-gradient(119.91deg, #7C60BE 9.31%, #FF3275 9.32%, #8866D6 9.33%, #AB67E0 34.16%, #BB5CE1 49.5%, #C440DB 67.31%, #C222CF 88.86%)
      }
  
      @media (max-width: 2000px) {
        .container .img-item:nth-last-child(1) {
          display: none;
        }
      }
  
      @media (max-width: 1800px) {
        .container .img-item:nth-last-child(-n+2) {
          display: none;
        }
      }
  
      @media (max-width: 1536px) {
        .container .img-item:nth-last-child(-n+3) {
          display: none;
        }
      }
  
      @media (min-width: 769px) and (max-width: 1280px) {
        .container .img-item:nth-last-child(-n+5) {
          display: none;
        }
      }
  
      @media (max-width: 768px) {
        .title-wrap {
          font-size: 1.125rem;
          line-height: 1.5rem;
          padding: 0;
        }
        
        .title {
          font-weight: 700;
          color: #fff;
        }
        
        .container {
          overflow-x: auto;
          -webkit-overflow-scrolling: touch;
          align-items: stretch;
          justify-content: start;
          -ms-overflow-style: none; /* IE and Edge */
          scrollbar-width: none; /* Firefox */
        }
  
        .fa {
          display: none;
        }
  
        .img-item {
          flex: none;
          width: auto;
        }
  
        .img-text {
          font-size: 12px;
        }
  
        span {
          margin: 4px;
        }
  
        .live {
          margin: 4px;
        }
      }
    </style>
